class Solution1727{
    public int largestSubmatrix(int[][] matrix) {
    	//step 1, survey consecutive one count and stores back into original matrix


    	for (int j=0; j<matrix[0].length; j++) {    		
    		for (int i=1; i<matrix.length; i++) {
    			if(matrix[i][j] == 1) {
    				matrix[i][j] = matrix[i-1][j] + 1;
    			}//fi
    		}//rof
    	}//rof
		//System.out.println("matrix arr: " + Arrays.deepToString(matrix));
		
		//step 2, loop through each row and populate count array, then find the max area given row
		int maxArea = 0;
        for(int[] row:matrix){
            Arrays.sort(row);
            for(int j=1; j<=row.length; j++){
            	maxArea = Math.max(maxArea, j*row[row.length-j]);
            }//rof
        }//rof

        return maxArea;
    }//end method
    
}// end class

class Solution1727_v2{
    public int largestSubmatrix(int[][] matrix) {
    	//step 1, survey consecutive one count and stores back into original matrix


    	for (int j=0; j<matrix[0].length; j++) {    		
    		for (int i=1; i<matrix.length; i++) {
    			if(matrix[i][j] == 1) {
    				matrix[i][j] = matrix[i-1][j] + 1;
    			}//fi
    		}//rof
    	}//rof
		//System.out.println("matrix arr: " + Arrays.deepToString(matrix));
		
		//step 2, loop through each row and populate count array, then find the max area given row
		int[] cons1CntArr;
		int maxArea = 0;
    	for (int i=matrix.length-1; i>=0; i--) {    
    		if ((i+1)*matrix[0].length <= maxArea) {
    			continue;
    		}//fi
    		cons1CntArr = new int[matrix.length+1];
    		for (int j=0; j<matrix[0].length; j++) {
    			cons1CntArr[matrix[i][j]]++;    			
    		}//rof
    		maxArea = Math.max(getMaxArea(cons1CntArr),maxArea);
    	}//rof

		
        return maxArea;
    }//end method
    
    /**
     * get maximum area given count array that stores consecutiveness information
     * precondition:
     * - assumes cons1CntArr is valid
     * @param cons1CntArr - int[]
     * @return max area
     */
    private int getMaxArea(int[] cons1CntArr) {
    	int currArea, maxArea = 0;
    	int colCount = 0;
    	for (int i=cons1CntArr.length-1; i>0; i--) {
    		colCount += cons1CntArr[i];
    		currArea = i*colCount;
    		maxArea = Math.max(maxArea, currArea);
    	}//rof
    	return maxArea;
    }//end method
}// end class
